-- Crear tabla observaciones_naturalista
CREATE TABLE observaciones_naturalista (
    id SERIAL PRIMARY KEY,
    id_ejemplar VARCHAR(100) UNIQUE NOT NULL,
    id_nombre_cat_valido VARCHAR(50),
    especie_valida_busqueda VARCHAR(100) NOT NULL,
    comentarios_cat_valido TEXT,
    categoria_taxonomica VARCHAR(50),
    entid INTEGER,
    munid INTEGER,
    anpid INTEGER,
    ecorid INTEGER,
    latitud DECIMAL(10, 7) NOT NULL,
    longitud DECIMAL(10, 7) NOT NULL,
    localidad VARCHAR(500),
    municipio VARCHAR(100),
    estado VARCHAR(100),
    pais VARCHAR(100) DEFAULT 'MEXICO',
    fecha_colecta DATE,
    colector VARCHAR(255),
    coleccion VARCHAR(255),
    probable_loc_no_de_campo VARCHAR(255),
    ejemplar_fosil VARCHAR(50),
    institucion VARCHAR(255),
    pais_coleccion VARCHAR(100),
    proyecto VARCHAR(100),
    url_proyecto VARCHAR(500),
    url_ejemplar VARCHAR(500),
    url_origen VARCHAR(500),
    id_original INTEGER,
    tipo_coleccion INTEGER,
    id_nombre_cat_valido_orig VARCHAR(50),
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP
);

-- Índices
CREATE INDEX idx_obs_nat_estado ON observaciones_naturalista(estado);
CREATE INDEX idx_obs_nat_municipio ON observaciones_naturalista(municipio);
CREATE INDEX idx_obs_nat_fecha ON observaciones_naturalista(fecha_colecta);
